import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      weather: [],
      error: null,
      isLoaded: false,
      items: [],
    }; // end constructor
  }

  componentDidMount() {
    // Fetch Function Goes here
    fetch(
      "https://api.openweathermap.org/data/2.5/weather?q=alameda&appid=5641904b9f9d3a2b1751db682fa354ff"
    )
      .then((res) => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.items,
          });
        },
        (error) => {
          this.setState({
            isLoaded: true,
            error,
          });
        }
      );
  } // End Component Did Mount
  //https://api.openweathermap.org/data/2.5/weather?q=alameda&appid=5641904b9f9d3a2b1751db682fa354ff

  render() {
    const error = this.state.error;
    const isLoaded = this.state.isLoaded;
    const items = this.state.items;
    if (error) {
      return <div> ERror: {error.message}</div>;
    } else if (!isLoaded) {
      return <div> Loading....</div>;
    } else {
      return (
        <div>
          {console.log(items)}
          <h1> {this.state.isLoaded} </h1>
        </div>
      );
    }
  }
} // End Class

export default App;
